import React from "react";

const NoteItems = (props) => {
  const { note } = props;
  return (
    <div className="d-flex">
      <div class="card">
        <div class="card-body">
          <h5 class="card-title">{note.title}</h5>
          <p class="card-text">{note.description}</p>
        </div>
        <div>
          <a href="#">
            <i class="fa fa-trash-o" />
          </a>
          <br />
          <a href="#">
            <i class="fa fa-edit"></i>
          </a>
        </div>
      </div>
    </div>
  );
};

export default NoteItems;
